import React from 'react'

function SevicioList(props) {
    return (
        <div>SevicioList

        {props.servicios && propsservicios.map(servicio =>{
            return(
            <div key = {servicio.id} >
                
                <h3> {servicio.title} </h3>

                <p>{servicio.description}</p>

                <p>{servicio.image}</p>

            </div>  
            )
        })}

        </div>
    )
}

export default SevicioList
